import { Card, Col, Row } from 'antd';
import comp from "./comp.jpg"

export default class ShoppingList extends PureComponent {


    componentDidMount() {

    }

    render() {
        return (
            <div>
                <div className="site-card-wrapper">
                    <Row gutter={16}>
                        <Col span={6}>
                            <Card bordered={false}
                                hoverable
                                style={{ width: "150px", height: "150px" }}
                                cover={<img alt="example" src={comp} />}
                            >

                            </Card>
                        </Col>
                        <Col span={6}>
                            <Card title="Card title" bordered={false}>
                                Card content
                            </Card>
                        </Col>
                        <Col span={6}>
                            <Card title="Card title" bordered={false}>
                                Card content
                            </Card>
                        </Col>
                        <Col span={6}>
                            <Card title="Card title" bordered={false}>
                                Card content
                            </Card>
                        </Col>
                    </Row>
                </div>
            </div>
        );
    }
}
